import { combineReducers } from 'redux';
import postReducer from './postReducer';
import tickets from '../search/tickets/reducers';
import airports from '../search/airports/reducers';

export default combineReducers({
    userData: postReducer,
    errors: postReducer,
    tickets,
    airports
});
